
def dna(seq):
	min_number = 5
	protein_percent = 0.3
	number_nucleo = 4
	number_per_codon = 3
	name =seq[0] 
	nucleo = seq[-1].upper()
	junk = 0
	while "-" in nucleo:
		index = nucleo.find("-")
		nucleo = nucleo[:index] + nucleo[index+1:]
		junk += 1
# I left a space after the colon because it made the output look cleaner imo
	print("Region name: " + name )
	print("Nucleotides: " + nucleo)
	print("Nuc. Counts: " + str(num_count(nucleo)))
	print("Total Mass%: " + str(mass(nucleo, junk)) + " of " + str(round(nucleo.count("A") * 135.128 + nucleo.count("C") * 111.103 + nucleo.count("G") * 151.128 + nucleo.count("T") * 125.107 + junk * 100.000, 1)))
	print("Codons List: " + str(codon_list(nucleo)))
	print("Is Protein?: " + protein_check(nucleo))

def num_count(nucleo):
	nuc_counts = [nucleo.count("A"), nucleo.count("C"), nucleo.count("G"), nucleo.count("T")]
	return nuc_counts

def mass(nucleo, junk):
	A = nucleo.count("A") * 135.128
	C = nucleo.count("C") * 111.103
	G = nucleo.count("G") * 151.128
	T = nucleo.count("T") * 125.107
	trash = junk * 100.000
	totalmass = A + C + G + T + trash
	t_mass = [round(A*100/totalmass,1), round(C*100/totalmass,1), round(G*100/totalmass,1), round(T*100/totalmass,1)]
	return t_mass

def codon_list(nucleo):
	ls = []
	for i in range(0, len(nucleo), 3):
		ls.append(nucleo[i:i+3])
	return ls
#Check to see if it ends with the proper codon 
def protein_check(nucleo):
	if codon_list(nucleo)[0] == "ATG":
		if codon_list(nucleo[-1] == "TGA" or "TAG" or "TAA"):
			if len(codon_list(nucleo)) >= 5:
				if ((nucleo.count("C") * 111.103 + nucleo.count("G") * 151.128)/(nucleo.count("A") * 135.128 + nucleo.count("C") * 111.103 + nucleo.count("G") * 151.128 + nucleo.count("T") * 125.107 + nucleo.count("-") * 100.000) > 0.3):
					return "YES"
	return "NO"

